import csvToJson from 'csvtojson';
import CSVFile from "../DNIT-Distancias.csv"

const csvFilePath = '../DNIT-Distancias.csv';


const convertedCsv = await csvToJson().fromFile(csvFilePath);


export default convertedCsv;
